import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.jsx'

function createcards(contact){
  return (
    <cal.Cardz 
      key = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
    />
  )
}

ReactDOM.render(
  <App />,
  document.getElementById('roots')
);

